import logo from './logo.svg';
import './App.css';
import Home from './pages/Home';

function App() {
  return (
    <Router>
      <Header />
        <Routes>
          <Route
            path = '/'
            exact
            element ={<Home />}/>
          <Route
            path = '/pages/Home'
            exact
            element ={<Game />}/>
          <Route
            path = "/AboutMe"
            element ={<Login />}/>
            <Route
            path="/Portfolio"
            element={<Scores />}/>
        </Routes>
      <Footer />
    </Router>
  );
}

export default App;
